}
.styling__button:hover strong::after, .styling__button.show strong::after {
  content: " ";
  position: absolute;
  bottom: -1em;
  width: 100%;
  border-bottom: 5px solid #146ebe;
  transform: translateX(-100%);
}
.styling__button strong {
  display: initial;
  position: relative;
  font-size: 1.2em;
  letter-spacing: 0.2em;
}
.styling__button:hover strong, .styling__button.show strong {
  color: #146ebe;
}
.styling__icon-container {
  justify-content: center;
  height: 21.25em;
}
.styling__icon {
  font-size: 10em;
}
.styling__options-container {
  display: block;
  padding-bottom: 1.5em;
}
.styling__options {
  display: none;
  padding: 0 2em;
}
.styling__options.show {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: repeat(2, 2em);
  gap: 0.7em 0.5em;
  /* grid-template-rows:  */
}
.styling__item {
  cursor: pointer;
}
.styling__item input {
  display: none;
}
.styling__item input:checked + .styling__custom-input .styling__custom-checked {
  display: flex;
  justify-content: center;
  align-items: center;
}
.styling__item strong {
  flex: 1;
}
.styling__custom-input {
  position: relative;
  display: block;
  width: 1.2em;
  height: 1.2em;
  margin-right: 0.5em;
  border-radius: 100%;
  background-color: #fff;
  overflow: hidden;
}
.styling__custom-checked {
  display: none;
  position: absolute;
  width: 100%;
  height: 100%;
  background-color: #183153;
}
.styling__custom-checked span {
  position: relative;
  background-color: #fff;
  width: 0.5em;
  height: 0.5em;
  border-radius: 100%;
}
.styling__html-container {
  background-color: #183153;
  padding: 0 4em;
  height: 6.5em;
}
.styling__html {
  display: block;
  color: #fff;
}
