  display: none;
}
.styling__link-container {
  flex-direction: column;
  align-items: flex-start;
  flex: 1;
}
.styling__link-item {
  flex: 50%;
  padding: 0.7em 0;
}
.styling__link {
  display: flex;
  text-decoration: underline;
}
.styling__link-icon {
  color: #146ebe;
  font-size: 1.2em;
  margin-right: 0.8em;
}

@media only screen and (max-width: 1148px) {
  .styling {
    flex-direction: column-reverse;
  }
  .styling__visor, .styling__right-container {
    width: 100%;
  }
