    display: flex;
  }
  .styling__right-top-container > * {
    padding: 0 0.5em;
  }
  .styling__description {
    flex: 0 1 47%;
  }
  .styling__link-block {
    flex: 1;
  }
  .styling__link-container--right li {
    padding-left: 2em;
  }
  .styling__aside-link {
    display: none;
  }
  .styling__aside-link--mob {
    display: inline-block;
    margin: 1em 0 5em 0;
  }
}
@media only screen and (max-width: 767px) {
  .styling__options.show {
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: repeat(3, 2em);
  }
  .styling__right-container {
    align-items: flex-start;
  }
  .styling__right-top-container {
    display: block;
  }
  .styling__right-top-container > * {
    flex: unset;
  }
  .styling__aside-link {
    display: block;
    padding: 0.9375em 2em;
  }
  .styling__aside-link div {
    justify-content: center;
  }
  .styling__aside-link--mob {
    display: none;
  }
  .styling__link-container {
    padding-bottom: 2em;
  }
  .styling__link-container--right li {
    padding-left: 0;
  }
  .styling__item button {
    font-size: 9px;
  }
  .styling__icon {
    font-size: 8em;
  }
}

